(75, 0, 'Exide Xpress XP800 (80AH)', 'exide-xpress-xp800-80ah', NULL, 0, NULL, NULL, '<ul>\r\n	<li>Withstands bumps and vibrations: Special polypropylene container with strengthening ribs makes the battery strong enough to withstand bumps and vibrations.</li>\r\n	<li>Made for Indian environment: Special Hybrid Alloy System ensures that the battery can withstand high temperatures.</li>\r\n	<li>Quick recharge - Unique tree radial grid design, lower internal resistance and a special paste chemistry increases recharging potential during use.</li>\r\n	<li>Magic eye: to check state of the charge &amp; electrolyte level of the battery.</li>\r\n	<li>Leak-resistant design: Side vented lid with electrolyte flow back system reduces chance of electrolyte leakage during handling.</li>\r\n	<li>Enhanced safety: Micro-porous filter disc in vent openings help arrest acid fumes and restrict spark propagation inside the battery.</li>\r\n	<li>Improved cycle life: Double-clad separation in the form of a unique rib-free separator profile, reinforced with texturised glass mat, provides surface support to the active material, thereby improving cycle life and resistance to bumps and vibrations.</li>\r\n	<li>Maintenance-free: Special alloy ensures low water loss during high temperature operations, requires topping up only once in 6 months.</li>\r\n	<li>Ready to use &ndash; comes factory-charged in ready to use condition.</li>\r\n</ul>', '7221.00', '7000.00', '5500.00', '9', '287', '206', NULL, '0.00', NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 1, NULL, NULL, NULL, '2019-04-19 00:00:00', '2019-09-21 10:47:20');
