(82, 0, 'Exide Mileage ML38B20L', 'exide-mileage-ml38b20l1', NULL, 0, NULL, NULL, '<ul open=\"\" sans=\"\" style=\"padding-left: 20px; box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; color: rgb(85, 85, 85); font-family: \">\r\n	<li style=\"box-sizing: border-box; margin-bottom: 8px;\">Special Duplex Cover Design &ndash; provides excellent spill-resistant characteristics.</li>\r\n	<li style=\"box-sizing: border-box; margin-bottom: 8px;\">More Power &ndash; Power grids are structurally durable and last longer than traditional grids; thanks to a robust design that minimizes corrosion.</li>\r\n	<li style=\"box-sizing: border-box; margin-bottom: 8px;\">Easy to use &ndash; comes factory-charged and in ready-to-use condition.</li>\r\n	<li style=\"box-sizing: border-box; margin-bottom: 8px;\">Robust design &ndash; It helps to take care of stringent application requirements.</li>\r\n	<li style=\"box-sizing: border-box; margin-bottom: 0px;\">Major Conductivity &ndash; The grid design reduces the internal resistance of the battery thereby providing the proper flow of the current. This provides optimal performance when the engine is started.</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>', '4430.00', '4200.00', '3500.00', '277', '278', '206', NULL, '0.00', NULL, NULL, 2, NULL, 1, 0, 1, 0, 0, 1, NULL, NULL, NULL, '2019-08-19 00:00:00', '2020-02-23 10:21:44'),
(83, 0, 'Exide Xpress XP1500 (150AH)', 'exide-xpress-xp1500-150ah', NULL, 0, NULL, NULL, '<ul>\r\n	<li style=\"text-align: justify;\">Withstands bumps and vibrations: Special polypropylene container with strengthening ribs makes the battery strong enough to withstand bumps and vibrations.</li>\r\n	<li style=\"text-align: justify;\">Made for Indian environment: Special Hybrid Alloy System ensures that the battery can withstand high temperatures.</li>\r\n	<li style=\"text-align: justify;\">Quick recharge - Unique tree radial grid design, lower internal resistance and a special paste chemistry increases recharging potential during use.</li>\r\n	<li style=\"text-align: justify;\">Magic eye: to check state of the charge &amp; electrolyte level of the battery.</li>\r\n	<li style=\"text-align: justify;\">Leak-resistant design: Side vented lid with electrolyte flow back system reduces chance of electrolyte leakage during handling.</li>\r\n	<li style=\"text-align: justify;\">Enhanced safety: Micro-porous filter disc in vent openings help arrest acid fumes and restrict spark propagation inside the battery.</li>\r\n	<li style=\"text-align: justify;\">Improved cycle life: Double-clad separation in the form of a unique rib-free separator profile, reinforced with texturised glass mat, provides surface support to the active material, thereby improving cycle life and resistance to bumps and vibrations.</li>\r\n	<li style=\"text-align: justify;\">Maintenance-free: Special alloy ensures low water loss during high temperature operations, requires topping up only once in 6 months.</li>\r\n	<li style=\"text-align: justify;\">Ready to use &ndash; comes factory-charged in ready to use condition.</li>\r\n</ul>', '14420.00', '13000.00', '10500.00', '16', '283', '206', NULL, '0.00', NULL, NULL, 0, NULL, 1, 0, 0, 0, 0, 1, NULL, NULL, NULL, '2019-04-19 00:00:00', '2019-09-21 10:45:45'),
