(11, 21, 'DATING BACK FROM THE MIDDLE AGES…..', NULL, 'dating-back-from-the-middle-ages', '<p>Nightwear has a big history, dating from the ancient time sleepwear, dressing gowns, and nightcaps have served to keep the body and head warm of people who lived in cooler climates with limited indoor heating. People&rsquo;s views of morality and existing customs have also had an effect on the relevance of sleepwear.<br />\r\n<br />\r\nThe nightclothes originally worn in Europe since the Middle Ages were inspired by the styles of Egyptian, Roman, Asian, and Indian costumes. In the past, sleepwear was usually home-made and the prevailing patterns were simple and easy to assemble.<br />\r\n<br />\r\n<strong>PYJAMA:</strong><br />\r\n<br />\r\nThe pyjamas introduced in Europe in the seventeenth and the eighteenth centuries were the adaptations of the harem pants worn in Southern and Western Asia.<br />\r\n<br />\r\n<img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/coco-chanel.jpg\" /><br />\r\n<br />\r\nThe name pyjama (pajamas or pj&rsquo;s) originates from the Hindustani word &ldquo;epai-jaima&rdquo;. Coco Chanel (1883-1971) was the first designer to promote a line of attractive lounging and beachwear pyjamas, and to persuade women that pyjamas could be as flattering as the traditional nightgown.&nbsp;<br />\r\n<br />\r\nNIGHTGOWN:&nbsp;<br />\r\n<br />\r\nIn the 17th and the 18th centuries, the term nightgown denoted an informal morning gown, house dress, or banyan worn by both males and females.&nbsp;<br />\r\n<br />\r\nThe style for the original dressing gowns was inspired by the kimono and banyan worn in the Far East and in India for many centuries.&nbsp;<br />\r\n<br />\r\nIn the twenty-first century, companies started to offer nightgowns including romantic old-fashioned cotton &ldquo;nightdresses&rdquo;. Later comfortable oversize knitted sleep shirts came as fashion.<br />\r\n<br />\r\nNow sexy satin baby dolls, shorts set and nightdress reflecting the many roles and moods of modern women.</p>\r\n\r\n<p><img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/3543aa7fb967bc0b7de46b987cebf2f1038285792a13f67f2apimgpsh_fullsize_distr.jpg\" /></p>', '2019-07-20 00:00:00', 0, NULL, NULL, NULL, 1, 1, '2019-07-20 09:11:55', '2019-07-20 10:05:25'),
(12, 21, 'A HAPPY BIRTHDAY TO ALL OUR GLAMOUROUS AQAURIUS GIRLS IT’S YOUR MONTH, LET’S CELEBRATE', NULL, 'a-happy-birthday-to-all-our-glamourous-aqaurius-girls-it-s-your-month-let-s-celebrate', '<p>Bold and beautiful, thoughtful and decisive, unique and distinct are characteristics profile of the most intellectual zodiac sign &ldquo;AQUARIUS&rdquo;. Glam girls celebrate your birthday this month, yes this month is Aquarius month. Those born under Aquarius, the 11th sign of the zodiac, are typically inventive, original, and want to make the world a better place.</p>\r\n\r\n<p>Aquarius follows a different fashion trend than the current. They set up their own fashion goals and trends. You girls are born in the month like some of our glam girls Jennifer Aniston, Isla Fisher, Emma Roberts, Brandy, Kelly Rowland, Oprah Winfrey, Christina Ricci, Mischa Barton, and Denise Richards. This free-spirited bunch is also known for wearing effortless, boho styles. You can find the following traits in an Aquarius closet.</p>\r\n\r\n<ul>\r\n	<li>Aquarius is very choosy in colors they always go for bright pinks or bold blues. Coral &amp; fuschia are the best colors in their closet&nbsp;</li>\r\n	<li>Never a fashion follower, Aquarius woman is often positively contrary, swishing around in maxi dresses when minis are &nbsp;&ldquo;in&rdquo; and inspiring trends of her own.</li>\r\n	<li>The retro look suits best for Aquarius best.&nbsp;</li>\r\n	<li>Aquarius woman loves to dress in a simple way. She will go for comfort over fashion, any day.&nbsp;</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Tips to bring out your inner Aquarian beauty:</strong> Accentuate your sparkling eyes with a pretty blue or violet shadow, toss your hair back into a carefree ponytail, and spritz yourself with fragrances that are citrus-based, crisp, and airy.</p>\r\n\r\n<p><img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/glam-girls.jpg\" /></p>', '2019-07-20 00:00:00', 2, NULL, NULL, NULL, 1, 1, '2019-07-20 09:23:48', '2019-07-20 10:05:28'),
(13, 21, '# LOVE THE BODY YOU LIVE #', NULL, 'love-the-body-you-live', '<p>For this New Year get the &lsquo;New You&rsquo;, get the toned body, confident mind and look. This is the time to care for your body and soul.&nbsp;</p>\r\n\r\n<p>You deserve the best always, so grab your favorite workout attire and a pair of shoes, indulge in your favorite exercise session to shed those extra pounds and keep your mind and body active.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &ldquo;Age is no barrier it&rsquo;s the limitation we put on our mind&rdquo;</p>\r\n\r\n<p>So it&rsquo;s never too late for anything to start. Set your mind and make a new target and move on. Let&rsquo;s get some good advice from our fitness freak.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>BIPASHA BASU &ndash; LOVE THE BODY YOU LIVE.</strong><br />\r\n<br />\r\nOur Bollywood diva follows a disciplined lifestyle and a workout plan to maintain her vital stats 36-28-36, every girl&rsquo;s dream for a fab body. At the age of 37 she has released 2 fitness Dvd&rsquo;s, let&rsquo;s see our glam girl&rsquo;s secrets for a fit and active life.</p>\r\n\r\n<p><strong>DIET</strong></p>\r\n\r\n<p>She enjoys eating simple home cooked Bengali food. Her diet includes egg whites in whichever form possible, steamed fish, nuts, green tea, vegetables like broccoli and mushrooms etc.</p>\r\n\r\n<p><strong>WORKOUT</strong></p>\r\n\r\n<p>She follows a complete workout regime and an alternative one also. According to Bipasha monotony workout causes disinterest, her advice is to make changes to keep workouts enjoyable and fresh. Adding kick boxing &nbsp;, aerobics or a Zumba session will make your workout more interesting.</p>\r\n\r\n<ul>\r\n	<li>Complete upper body regime.</li>\r\n	<li>Abs workout.</li>\r\n	<li>Lower body and legs workout.</li>\r\n	<li>Gluteus regime.&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>LOVE YOURSELF</strong><br />\r\n<br />\r\nOne should love oneself to love your body. &lsquo;Enjoy being who you are&rsquo; is her mantra to a happy life. Our diva firmly believes that one needs strong determination and discipline to live a fit and healthy lifestyle.</p>', '2019-07-20 00:00:00', 0, NULL, NULL, NULL, 1, 1, '2019-07-20 09:31:03', '2019-07-20 10:05:36'),
(14, 21, '?HAPPY#SAD#LONELY#ANGRY#IN LOVE !', NULL, 'happy-sad-lonely-angry-in-love', '<p><strong>JUST HIT THE GYM AND WORKOUT</strong></p>\r\n\r\n<p><strong>&nbsp;REJUVE YOURSELF WITH ATIVO</strong></p>\r\n\r\n<p>Take care of your body it&rsquo;s the only place you have to live in&rdquo;</p>\r\n\r\n<p>Your workout attire is as important as your workout regime. So choose the right clothes for your workout session to get the trendy look. ATIVO is a brand designed passionately for women who love to look cool even when they sweat. Let&rsquo;s check out the most amazing stuff of ATIVO for your &ldquo;stay fit&rdquo; time.</p>\r\n\r\n<p><strong>For your Workout time:</strong></p>\r\n\r\n<p>It&rsquo;s 6 am, hit the Gym with this super comfort Capri and shorts with fluo waistband and tank top. Pair it up with your favorite sports shoes and head Band to get the complete workout look.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>GET INTO THE MORNING BREEZE:</strong></p>\r\n\r\n<p>A good morning walk or jog is the best way to get the feel of morning breeze and stay fit. Grab this ribbed capris, layered tank top and hoody from ATIVO. Pair it with your favorite jogging shoes and start your day.</p>\r\n\r\n<p><img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/blog-5-2nd.jpg\" /></p>', '2019-07-02 00:00:00', 3, NULL, NULL, NULL, 1, 1, '2019-07-20 09:35:16', '2019-07-20 10:06:12'),
(15, 21, 'BESTSELLERS', NULL, 'bestsellers', '<p><strong>&ldquo;Charcoal Rose Short Set&rdquo;</strong></p>\r\n\r\n<p>One of our most loved short set in Slumber Jill, this alluring style is our bestseller in short set category.</p>\r\n\r\n<ul>\r\n	<li>Super comfort short set is made in the most soothing and comfortable fabric cotton, which stays soft against skin.</li>\r\n	<li>Top with rose neck piping and button detailing on the Tee this set is truly the cutest way to unwind.</li>\r\n	<li>The button tab in the sleeves and the pocket detailing adds great appeal to the style.</li>\r\n	<li>Pairing with the cute shorts is the most adorable way to have a great lounge time. Lounge or cuddle into your bed with this short set.</li>\r\n</ul>\r\n\r\n<p><strong>&ldquo;Pink Grey Flower Chemise&rdquo;</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/pink-aop.jpg\" /><br />\r\n&nbsp;</p>\r\n\r\n<p>All over floral printed peach color chemise, coral color lace with sweetheart neck, with adjustable shoulder straps.</p>\r\n\r\n<ul>\r\n	<li>Floral prints are all time dazzling style in the babydoll collection.</li>\r\n	<li>A cute v neck in lace adds great look to the style.</li>\r\n	<li>Knee length Chemise in A&rsquo; line silhouette is the most spectacular style</li>\r\n</ul>\r\n\r\n<p><strong>&ldquo;Yellow/Green Selfie Sleepshirt&rdquo;</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/dip-dye.jpg\" /></p>\r\n\r\n<p>A Sleepshirt for you with the charm of dip dye colors and an ode to Self.</p>\r\n\r\n<ul>\r\n	<li>The craft of the dip dye adds adorability to the style</li>\r\n	<li>The slub jersey fabric adds great appeal to the style</li>\r\n	<li>3/4th sleeves and mid-thigh length style is perfect way to lounge in chic fashion.</li>\r\n</ul>\r\n\r\n<p><strong>&ldquo;Pink Grey Flower Capri Set&rdquo;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://slumberjill.ii71.com/public/storage/blogs/capri.jpg\" /></p>\r\n\r\n<p>This bewitching Capri set is one of the best sellers in Slumber Jill collections</p>\r\n\r\n<ul>\r\n	<li>Pink top with contrast pocket, has a v neck with grey trims is the uniqueness of the style</li>\r\n	<li>Short sleeves with all over print cuff &nbsp;is the coolest feature.</li>\r\n	<li>All over print pink color Capri with elasticated waist band is the best way to match this top.</li>\r\n	<li>Let yourself be yourself in this perfect Capri set for your &ldquo;me time&rdquo;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '2019-07-20 00:00:00', 0, NULL, NULL, NULL, 1, 1, '2019-07-20 09:42:46', '2019-07-20 10:05:44'),
(16, 21, '#2#Love your body # Know your shape # Flatter your figure #', NULL, '2-love-your-body-know-your-shape-flatter-your-figure', '<p>Love yourself love your body, eventually your soul and mind will be happy . Shape of each woman &nbsp;varies &nbsp;according to &nbsp;their skeletal structure and every woman in unique and beautiful in their own way. Brilliancy in choosing the style and color will give you a flattering look. Here are simple and effective tips and tricks in this blog for our lovely pear shaped women to get the gorgeous look.</p>\r\n\r\n<p>Pear shaped women are well proportionate but have gained little weight in their lower body. Have you got Pear shape then you are in a good company with Shakira, Kim kardashian, Rihanna, Jennyfer Lopez. And here we have our Bollywood divas Ileana D cruz, Sonam Kapoor, Kareena Kapoor.</p>\r\n\r\n<ul>\r\n	<li><strong>Your best assets:</strong> Slim arms, defined waistline and curvier bottom.</li>\r\n	<li><strong>Your Challenge:</strong> Narrow Shoulder</li>\r\n</ul>\r\n\r\n<p><br />\r\nThe secret is to balance your body with appropriate clothing and accessories to get the ravishing look.</p>\r\n\r\n<p>Our Aim is to create a slim lower body proportionate to your upper body, elongate your figure to get a sculpted look.</p>\r\n\r\n<p><br />\r\n<strong>For the toned look:</strong></p>\r\n\r\n<ul>\r\n	<li>To get a perfect fit and look, use a fitted push up bra with a lower body shape wear to get curvier look.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>For your best assets:</strong></p>\r\n\r\n<ul>\r\n	<li>Dark colors slim down your bottom and will give you a nice look.</li>\r\n	<li>Clean and tailored lined bottoms, a line skirt or a flared skirt is the best add on to your bottom line.</li>\r\n	<li>Wear pants or jeans that have a flared bottom to draw eye away from your hips.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Flatter your upper body:</strong></p>\r\n\r\n<ul>\r\n	<li>Tunic tops and fitted dress are your best buddies will give you a great look.</li>\r\n	<li>A longer jacket or a cute blazer creates a long, lean line and covers the hip area.</li>\r\n	<li>Detailed neckline with necklaces or plunge neckline will draw more attention to your upper body</li>\r\n	<li>To look more sexy always try to expose your shoulder especially for pear shaped it&rsquo;s the most sexy in their figure</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Accessories:</strong></p>\r\n\r\n<ul>\r\n	<li>A great pair of earrings and a fabulous necklace will make you look gorgeous.</li>\r\n	<li>Have a scarf around your neck to look cute</li>\r\n	<li>Clutch purses and bags that sit on your waist is a perfect choice.</li>\r\n	<li>Pointy toed shoes with wide pants give you a great look.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Tips to maintain your looks</strong></p>\r\n\r\n<ul>\r\n	<li>Strengthening exercise like push-ups will give your bust a toned and defined look.</li>\r\n	<li>Squats and lunges to build muscles in your lower back will give you a toned and curvy structure.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We would be happy if you can drop your comments and share your experience with this style tips</p>', '2019-07-20 00:00:00', 0, NULL, NULL, NULL, 1, 1, '2019-07-20 09:53:05', '2019-07-20 11:59:31'),
(17, 21, '#Love your body # Know your shape # Flatter your figure', NULL, 'love-your-body-know-your-shape-flatter-your-figure', '<p>Love yourself love your body, it&rsquo;s the only one you have it. Body shape of each woman differs just like their wardrobe it is unique and beautiful. Simple tips and tricks will make you flattering and look gorgeous. Choosing the right color and the style is the brilliant way to look alluring. In this blog let&rsquo;s discuss how we can make our apple shaped girls more angelic and ravishing.</p>\r\n\r\n<p>Apple shaped women are well proportionate but have gained little weight in their bust and tummy area. Have you got an apple shape then you are in a good company with Angelina Jolie, Drew Barrymore, Katy Perry, Catherina Zeta-Jones and Elizabeth Hurley. And here we have our Bollywood divas.</p>\r\n\r\n<ul>\r\n	<li><strong>Your best assets:</strong> Slim legs and arms and beautiful bust</li>\r\n	<li><strong>Your Challenge:</strong> Lack of waistline</li>\r\n</ul>\r\n\r\n<p><br />\r\nThe secret is to balance your body with appropriate clothing and accessories to get the ravishing look.</p>\r\n\r\n<p>Our Aim is to create a slim upper body proportionate to your lower body to give you a sculpted look.</p>\r\n\r\n<p><br />\r\n<strong>For the toned look:</strong></p>\r\n\r\n<ul>\r\n	<li>To get a perfect fit and look use a fitted bra with a tummy corset, don&rsquo;t go for full body shape wear.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>For the best assets:</strong></p>\r\n\r\n<ul>\r\n	<li>Straight cut shirts with button down, short collars and defined sleeve cuffs for a slim look.</li>\r\n	<li>Blazers and Jackets with no button styles and thick collars. Choose bright colors for slimming effect.</li>\r\n	<li>Blouses and tops with V necks, asymmetrical hems and wraps styles for slimming bust. Length must be below the hip bone.</li>\r\n	<li>Straight fit kurta with V neck will add feminine to the shape. Length should be above the knee to balance the lower and upper body. Vertical prints in bright colors.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>For those beautiful slender legs:</strong></p>\r\n\r\n<ul>\r\n	<li>Always chose wide and straight bottom trousers.</li>\r\n	<li>Palazzo pants are the best for you to balance the upper and lower body.</li>\r\n	<li>A line or a maxi skirt with a slit is the best way to bring the figure out.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Accessories:</strong></p>\r\n\r\n<ul>\r\n	<li>Always opt for small bags</li>\r\n	<li>Wear wedges and heels to give look to your long beautiful legs</li>\r\n	<li>Use a thin belt to make your body proportionate.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Tips to maintain your looks</strong></p>\r\n\r\n<ul>\r\n	<li>Strengthening exercise like push-ups will give your bust a toned and defined look.</li>\r\n	<li>Work out for abs like crunches will give a defined waistline</li>\r\n	<li>Squats and lunges to build muscles in your lower back will give you a curvy structure.</li>\r\n</ul>\r\n\r\n<p><br />\r\nWe would be happy if you can drop your comments and share your experience with this style tips</p>', '2019-07-20 00:00:00', 0, NULL, NULL, NULL, 1, 1, '2019-07-20 10:00:55', '2019-07-20 10:03:56'),
(18, 21, 'Lounge@SlumberJill', NULL, 'lounge-slumberjill', '<p>Night wears are designed to make a person&rsquo;s sleep comfortable and soothing. Our designers have made deep research and have customized the designs for the nightwear for each type of body and gender. The colors and the style are deeply researched to make a product giving soothing sleep. So it&rsquo;s very important to allow your skin to breathe and for this a nightwear plays a major role. The lounge wear and sleep wears are designed based on the following aspects,</p>\r\n\r\n<ul>\r\n	<li>Season and climate<strong> &nbsp; &nbsp;&nbsp;</strong></li>\r\n	<li>For winter heavier clothing with long sleeves and long pants</li>\r\n	<li>For summer light clothing with tank tops, short sleeves and shorts.</li>\r\n	<li>Convenience</li>\r\n	<li>Style and Design</li>\r\n	<li>Age group</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SlumberJill designers passionately design each and every style to give great comfort ability and sleep. Each style in Slumberjill is Unique in its design. So choose a style according to your needs and have a great nights sleep.&nbsp;</p>', '2019-07-20 00:00:00', 0, NULL, NULL, NULL, 1, 1, '2019-07-20 10:03:28', '2019-08-27 13:00:26');
