(2, NULL, 'Amaron', 'amaron', '<p>When it comes to car batteries, Amaron is one of the 1st names that come into our mind. Amaron batteries are very well-known for being the best batteries for cars. Most of the Amaron car batteries are compatible with all the cars. Amaron batteries come in many different power units. You need to choose a power unit depending on your car and the price of these batteries vary ion the different power units. You can look at the website of mybatteryshop to know the Amaron car battery price list. Buy these batteries from us to avail of a very good warranty for up to 55 months in which you get 30 months of a full replacement. There are many other warranty offers for a minimum of 12 months.</p>\r\n<p>The power units of these batteries are  35Ah, 50Ah, 74Ah, and the highest of 100Ah. You can choose one of them depending on how much battery backup you need. In bad conditions, Amaron does not take a lot of time to start up. Amaron batteries can startup very fast with the help of high cranking power. They come full of charge from the factory and ready to use. Buy Amaron car battery online from the website of mybatteryshop to avail of many discounts and free installation. Patented BIC vents help to increase the safety of these batteries and the spill-resistant plugs help to prevent any leaks. You can buy the Amaron car batteries for the best performance in any weather.</p>', '2_amron_banner.jpg', '2_amron_banner.jpg', 0, 1, 'Amaron Car Battery Price List, Amaron Battery for Car, Buy Amaron Car Battery Online', NULL, 'Mybatteryshop is the best online Amaron car battery store in Delhi, India that offers you to buy Amaron car batteries online. Get Amaron car battery price list, features & specifications.', 1, '2015-10-23 00:00:00', '2021-01-21 10:55:59'),
(3, NULL, 'Luminous Inverter Battery', 'luminous-inverter-battery', '<p>Luminous is a very well known company in India for making inverter batteries. They make many types of battery including tall tubular battery, short tubular battery, and flat plate battery. Luminous inverter battery is specially designed to withstand the power cuts in India. They have a longer period of power supply compared to other companies and they are low maintenance.</p> \r\n<p>You can get different prices for different types of batteries of luminous. Knowing all of the prices of different types of inverters will help you choose one for you. Visit our website to see the list of luminous inverter battery price to check the prices and pick the best one as per your price range. Places with long power cuts are ideal for using luminous batteries as they last longer compared to other batteries.</p> \r\n<p>The price of luminous batteries is cheap compared to others. You can choose many other companies to buy inverters, but none of them can provide such low maintenance as a luminous inverter battery. You can buy a luminous inverter battery online from our website to avail of many discounts or you can visit the store to buy any of the types of your choice.</p>', '3_1393861314.png', '3_1393861314.png', 0, 2, 'Luminous Inverter Battery Price, Luminous Tubular Battery, Buy Luminous Inverter Battery Online', NULL, 'We offer to buy Luminous inverter battery online at the lowest price in India. Get Luminous inverter battery price list, Luminous tubular battery price, features & specifications on mybatteryshop.in', 1, '2015-10-23 00:00:00', '2021-01-21 07:48:27'),
(5, 36, 'Su-Kam Inverter Battery', 'su-kam-inverter-battery', '<p>One of the feature-based inverter companies in the market, the batteries made by Su-Kam are known for its durability. Su-Kam inverter battery can be used for a long period without maintenance. These batteries are very well known for offering many features. Compared to other brands, this is one of the main reasons for people to trust them.</p>  \r\n<p>Su-Kam inverter batteries are priced depending on the extra long-lasting service, durability. Visit our online website to see the Su Kam inverter battery price and choose one of them depending on the price range. Batteries of Su-Kam can be used as back up power as Printers, televisions, and copiers. Long term battery performances are boosted with 30% more volume of acid compared to others.</p> \r\n<p>Su-Kam inverter battery comes with 2 years warranty. The intelligent thermal system comes with this type of batteries. Buying from us can also give you free installation along with many other discounts. You can visit our store to buy any type of Su Kam inverters, or you can also buy Su-Kam battery online as per your choice to get them delivered to your home free of cost. To get more information you can contact us.</p>', '5_sukam_logo.jpg', '5_sukam_logo.jpg', 0, 14, 'Su-Kam Inverter Battery Price, Su-Kam Tubular Battery, Buy Su-Kam Inverter Battery Online', NULL, 'We offer to buy Su-Kam inverter battery online at the lowest price in India. Get Su-Kam inverter battery price list, Su-Kam tubular battery price, features & specifications on mybatteryshop.in', 1, '2015-10-23 00:00:00', '2021-01-21 11:01:59'),
