(7, NULL, 'Okaya Inverter Battery', 'okaya-inverter-battery', '<p>Okaya batteries are one of the leading manufacturers of inverter batteries in India. Because of the durable and long-lasting nature, the customers love Okaya inverter battery. Okaya is the most trustable battery because it can be trusted to work for many years without proper maintenance. A double thick plate in the Okaya batteries makes it the ultimate choice for customers.</p> \r\n<p>The price list is very flexible from cheap to costly price. You can visit our website to see the listing of Okata inverter battery price. The pricing depends on the type, battery backup power, and other things of the inverter. Compared to others, Okoya is very long-lasting, durable, and saves a lot of energy. Okoya is very useful and commonly used in places with frequent power loss.</p> \r\n<p>Okaya inverter comes with 1-2 years of warranty but they last longer than that with almost no maintenance. We sell all types of Okaya batteries with great discounts and offers. If you want to buy them, you can visit our website online and buy an Okaya inverter battery online. Also, you can visit our shop to buy an Okaya inverter with free installation.</p>', '7_okaya_logo1.png', '7_okaya_logo1.png', 0, 4, 'Okaya Inverter Battery Price, Okaya Tubular Battery, Buy Okaya Inverter Battery Online', NULL, 'We offer to buy Okaya inverter battery online at the lowest price in India. Get Okaya inverter battery price list, Okaya tubular battery price, features & specifications on mybatteryshop.in', 1, '2015-10-23 00:00:00', '2021-01-21 07:48:38'),
(8, NULL, 'Digi Power Inverter Battery', 'digi-power-inverter-battery', '<p>Digi power is very well known in the inverter battery market. The tubular battery is very good and powerful among others. You can check the Digi power battery price list by visiting our online website. Tubular batteries come with 4 years warranty and other inverter batteries of Digi power comes with 3 years warranty. There are many ranges of prizes for different types of batteries.</p> \r\n<p>The difference between Digi power inverter battery price depends on many different things. Some of the common factors include the power of inverter and the type of inverter. Digi power inverters variety of capacity ranges starting from 140 to 200 Ah. Another key feature of Digi power inverter battery is its ability to reduce water topping with 30% more electrolytes compared to others.</p> \r\n<p>We provide free installation with free delivery while buying any of these Digi power inverter batteries. You can either visit our store to buy any type of Digi power inverters with discounts and free installation or buy Digi Power inverter battery online by visiting our online website. you will get the warranty and invoice emailed on your mail by purchasing inverters online.</p>', '8_digipower.png', '8_digipower.png', 0, 11, 'Digi Power Inverter Battery Price, Digi Power Tubular Battery, Buy Digi Power Inverter Battery Online', NULL, 'We offer to buy Digi Power inverter battery online at the lowest price in India. Get Digi Power inverter battery price list, Digi Power tubular battery price, features & specifications on mybatteryshop.in', 1, '2015-10-23 00:00:00', '2021-01-21 10:23:31'),
