(37, 92, 'Luminous Inverter', 'luminous-inverter', '<p>Luminous is a very famous brand and a very old player in the industry for a long time. These inverters are designed especially for the Indian power cuts. They are very useful to provide long battery life along with great durability. In many rural areas of India, power cuts are a very important issue and interrupted power supply causes many problems in daily life. You can visit the website of My Battery Shop to check the Luminous inverter price list. It will help you very much to choose one in your price range.</p> \r\n\r\n<p>The price of these inverters depends on the different capacities. There are many battery capacities available of Luminous inverter and home UPS to choose from. Some of the common battery capacities include 650VA, 850VA, 1650VA, 900VA, 65KVA, 2KVA, 1100KVA, and many more. If you buy a Luminous inverter online from My Battery Shop then you can exchange your old inverter to get a huge discount on the price. Luminous batteries are eco-friendly and provide more power with less consumption of power.</p>\r\n\r\n<p>The Luminous inverter and home UPS contains Adaptive Battery Charging Control (ABCC) which helps to optimize the usage of the power. Buy Luminous battery and home UPS online from My Battery Shop and avail 24 months of warranty with 18 months of a full replacement. We will also install the inverter in your home free of charge. You can use the inverter of Luminous with almost no maintenance. Try Luminous Inverter and home UPS today to get a smooth and uninterrupted power supply.</p>', '37_3_1393861314.png', '37_3_1393861314.png', 0, 21, 'Luminous Inverter Price List, Buy Luminous Inverter & Home UPS Online', NULL, 'We are the best online Luminous inverter & home UPS store in India that offers you to buy Luminous Inverter with free installation. Get Luminous inverter price list, features & specifications on Mybatteryshop.in.', 1, '2015-12-14 00:00:00', '2021-01-22 11:15:58'),
(38, 6, 'Microtek Inverter', 'microtek-inverter', '<p>Microtek is very popular around all the major cities in India. They manufacture very high capacity and efficient inverters. If you face frequent power cuts in your area and interrupted power supply, then Microtek inverters and home UPS are the best solutions for you. You can check the Microtek inverter price list in the My Battery Shop to choose the best one in your price range. There are many power units available from Microtek such as 700VA, 900Va, 1700VA, 1100KVA, 2000VA, 2600VA, and maximum of 10KVA.</p> \r\n\r\n<p>Mostly these inverters are used at home and other than that, you can use the inverter in shops, education institutes, and offices. One of the most important things that you can get from My Battery Shop is the exchange option. With the help of it, you can exchange old inverters and get huge discounts on the price. Along with that, if you buy Microtek inverter online, then you can also get up to 24 months of warranty that will help you in the time of any issues with the inverter. Along with that, buy Microtek inverter and home UPS online to get free installation and free delivery at your doorstep.</p>', '38_mt.jpg', '38_mt.jpg', 0, 22, 'Microtek Inverter Price List, Buy Microtek Inverter & Home UPS Online', NULL, 'We are the best online Microtek inverter & home UPS store in India that offers you to buy Microtek Inverter with free installation. Get Microtek inverter price list, features & specifications on Mybatteryshop.in.', 1, '2015-12-14 00:00:00', '2021-01-22 11:17:50'),
