(1, 0, 'Car Battery', 'car-battery', '<h2>Buy Car battery Online</h2>\r\n<b>Everything you need to know about car batteries</b>\r\n\r\n<p>The battery is the heart of any engine, whether it is a car or any other appliances or machines because without any proper working engine it is impossible to do any work. So, the battery is the source of energy or you can say the chemical reactions which are responsible for the work and work progress happen in the battery of any engine. If you are looking for an effective car battery at an affordable price range, My Battery Shop is considered as the perfect solution for you.</p>\r\n\r\n<p>There are so many different types of batteries available in the market and depending upon the brands the features and functions of the battery will change, so it is important to go through proper content or have some expert advice before you buy a new battery for your car. We are providing you the scope of purchasing car battery from different online battery store in Delhi.</p>\r\n\r\n<b>Advantages of car batteries from My Battery Shop</b>\r\n\r\n<p>My Battery Shop is considered as one of the best online car battery shops in India. We are offering you the scope of gathering knowledge about the latest car batteries that emerge in the market. Besides this, My Battery Shop is referred to as the user-friendly online battery shop. We are providing batteries of different upgraded car batteries that you get at high prices in regular battery stores at the market. But we are offering attractive discounts on premium batteries that will not only help you to save your money but also help you to protect your engine from severe damage.</p>\r\n\r\n<b>Types of car batteries provided by My Battery Shop</b>\r\n\r\n<p>Is it a good choice to examine the quality of different car batteries before investing money in it? My Battery Shop will provide you the scope of judging the quality of any battery by keeping an eye on different reviews provided by our clients.  There are different types of batteries present our website and all you need to do is to scroll our website and select any car battery of your choice.</p>\r\n\r\n<b>* Starting, lighting and ignition batteries:</b>\r\n<p>Starting, lighting, and ignition batteries are kinds of types of automotive batteries and these not only help the engine to start but also the other function of the car is controlled by these batteries such as the lighting functions, ignition function, radio and so on. These batteries have also the power to get charge within a short interval of time and also supply energy to the system within a short period. </p>\r\n\r\n<b>*Deep cycle batteries:</b>\r\n<p>Deep cycle batteries deliver energy to the whole system within a longer time than the SLI batteries and also they control and provide energy to the whole system of the car. These batteries are appropriate for the marine vehicles and golf carts because those provide sustainable energy throughout the system within a long interval of time. </p>\r\n\r\n<b>*Valve regulated lead-acid batteries:</b>\r\n<p>These batteries do not need any maintenance so you don’t need to put water into the battery cells regularly or frequently, but that also a fact that these batteries can’t work in most of the cases so you need to replace the batteries after a certain time. The batteries are sealed so there is no worry about spilling if these get inverted, so it is a great advantage for any user.</p>\r\n\r\n<b>*Wet cell or flooded batteries:</b>\r\n<p>The name implies major information about the batteries because those have a liquid which is the combination of sulphuric acid, lead and water, and these three elements are divided into a certain ratio and that makes the batteries electrolyte. These batteries offer the customer a less life battery life span and regular maintenance but these batteries are also less expensive than other car batteries in the market.</p>\r\n\r\n<b>*Lithium-ion batteries:</b>\r\n<p>To keep running with the exceeding numbers of vehicles on the road lithium-ion batteries are appropriate for that because those have the power to store the maximum amount of energy to keep running the whole system appropriately. But the major limitation of these batteries is the short life span so after a certain period, the batteries need to replace.</p>\r\n\r\n<p>From the upper content, it is clear that a car battery is the main soul of the car, so the first thing you need to do before selecting a battery for your car is making some analysis over all the features of that specific car battery which you are going to buy. Without knowing the features of the battery there is no sense to use the battery for your car. Every brand of the car battery has some different features and according to these features, the brands are making and launching different types of cars in the market. So in order to get the best quality car battery, you need to consult our website and buy online car battery at a minimum price. So hurry and grab your phone to order your favorite battery.</p>', 1, '260919093554-1.jpg', 0, 1, 1, 1, 0, 'Car Battery Price, Buy Car Batteries Online at Best Prices in India', NULL, 'Mybatteryshop is the best online car battery store in Delhi, India that offers you to buy car batteries online with free installation. Get lowest car battery prices, features & specifications.', '2019-09-18 05:41:54', '2021-01-13 11:05:35'),
(2, 0, 'Genset Battery', 'genset-battery', '<b>All you need to know about Genset batteries</b>\r\n<p>Batteries are the main soul of a whole system, only for the battery engine works accordingly and also it is important to check the battery status so that you can be updated about the working performance of the entire system. Genset battery is used in the emergency generator system to deliver energy to the generator engine. Today you can access various online shopping websites to choose the appropriate battery for the generators and also buy generator battery online.  To avail the benefit of high-quality Genset Battery you need to visit the website of My Battery Shop, India’s number one online battery shop.</p>\r\n\r\n<b>Advantages of Genset batteries provided by My Battery Shop</b>\r\n<p>The main advantage of a Genset battery offered by us is that you can avail of the service of different batteries that have the main function to provide power to the ancillary panes of the generator system including all the small motors in the enclosure at the time of operation. The motors which are used in the generator operation operate by DC. </p>\r\n<p>There are other facilities like if a secondary battery source set is used there then the primary battery set which is already in the generator system will provide back up to the secondary battery set. An AC source of the battery gives power to the entire automatic vent out there and the automatic transfer switch gives power to the grid and that is the reason why the power is being routed through all the vents in the system.</p>\r\n\r\n<b>Different types of Genset batteries you find after visiting our website</b>\r\n<p>There are mainly two types of Genset batteries mostly use in the industrial field, as it is mentioned above that the Genset batteries are mainly used in generator systems in some emergency cases.</p>\r\n<p>The sealed Genset batteries need very less maintenance by the users as the electrolyte has been provided there do not need any further addition so the users can be less worried when it comes to adding water to the electrolyte in the batteries. Still, sometimes it is required to check the battery status and also to check the condition of the solution in the battery. In those cases, there are individual caps in the Genset batteries to fill and check the electrolyte according to the need of the battery.</p>\r\n<p>There are so many suppliers in the market and also there are so many manufacturing options available in the market. Genset battery price depends on the suppliers in the market and also on the materials they use in manufacturing, depending upon the grades of the materials the price of batteries varies. My Battery Shop is a famous online retailer that gives you the best prices along with the best features of the Genset batteries.</p>\r\n\r\n<b>Tips for Selecting the best quality Genset batteries</b>\r\n<p>Select your Genset battery according to the need for your generator system such as for some heavy-duty the system needs high carbon technology. Some best suppliers have come with some exclusive features so that the system can meet all the requirements. High cranking power, instant power at all times whenever the system will demand it, less maintenance and minimum cost should be the basic criteria those need to follow at the time of manufacturing by the suppliers and buying when you need to purchase or choose an appropriate battery for the system. Buy Genset battery online through the appropriate and trustworthy websites and retailers so that you can get some confirmation at the time of purchasing. In this matter, My Battery Shop is trustworthy online retailers which have already created an impression in the market and is the one of them on which you can relay completely.</p>\r\n\r\n<b>Some innovative design in Genset batteries</b>\r\n<p>Some efficient and creative designs of Genset batteries are offering by My Battery Shop such as the innovative design of electrodes to maintain the smooth flow of current to all the terminals and these electrodes also help in getting the cranking current instantly.\r\nMy Battery Shop also provides its customers\' polypropylene copolymer containers with the batteries and their suppliers also manufacture the positive and negative plates with special calcium lead alloys to make the batteries more durable and corrosion-free.\r\nTheir superior Genset batteries are made up of active materials so that the performance of the batteries remain up to the mark and constant as the cranking current flow is instant and relevant. Because cranking current is an important aspect in the generator system and if the battery will fail to provide or maintain a smooth flow of cranking current throughout the entire system then it will be a serious issue and the system may corrupt gradually or instantly.</p>\r\n<p>The vent plugs have been designed with the ceramic disc so that the system can drawback the escaping water with natural gas. It is an important feature by them that they are providing to their customers at the best Genset battery price.</p>\r\n<p>The copper cell connectors are facilitated with high-quality current rating design so that you can be always updated with the status of the current flowing through all the terminals. Also, the connectors are covered with durable plastic material to avoid any electrical hazards that might be serious trouble for the entire system.</p>\r\n<p>Every blot in all the systems are especially lead-coated and corrosion resistant that also an important design aspect that is provided by My Battery Shop.</p>\r\n<p>So what are you waiting for? Now, these superior quality batteries can be available at your doorstep by your one click on the website of My Battery Shop. This retailer gets supplied with all the Genset batteries by some genuine and efficient suppliers who have been working for so long and have some relevant experience regarding all the equipment that is used in the manufacturing of the batteries. So, buy a generator battery online from My Battery Shop and get the best-featuring batteries to make your system long-lasting and efficient.</p>', 3, '260919093627-4.jpg', 0, 1, 1, 1, 0, 'Genset Battery Price, Buy Genset Batteries Online at Best Prices in India', NULL, 'Mybatteryshop is the best online genset battery store in Delhi, India that offers you to buy genset batteries online with free installation. Get lowest genset battery prices, features & specifications.', '2019-09-18 05:42:10', '2021-01-13 11:52:58'),
(3, 0, 'Inverter Battery', 'inverter-battery', '<b>All you need to know about inverter battery</b>\r\n<p>Inverter batteries are one of the most useful batteries in the market especially for the household appliances in the residential buildings. According to the needs of all appliances and the current consuming power of all appliances are the main things that need to be considered in this matter. There are also so many online retailers present in the market from where you can buy inverter battery online. But when it comes to the brand and warranty My Battery Shop is granted as the best spot to buy a quality battery that offers you the best inverter batteries with the warranty period.</p>\r\n<b>Benefits of purchasing Inverter Battery from My Battery Shop</b>\r\n<p>It is important to know basic about any inverter battery before availing its service. Here we provide you the scope to gather detailed knowledge about inverter battery.</p>\r\n<p>Inverter batteries usually give services for so long depending upon the maintenance. Inverter batteries have a long life span starting from five years to fifteen years if those get proper maintenance.  It is sustainable in nature and perfectly suitable for operating different kinds of electric appliances at a particular time. So, the inverter batteries are durable with high temperatures and rough usage because its spine is made up of using a high-pressure casting method.</p>\r\n<p>My Battery Shop is offering you the inverter batteries which can work in all kinds of situations. Besides this, we are providing you the facility to replace any inverter battery in case the product is finding faulty.</p>\r\n<p>We are offering you the best quality tubular batteries. Based on the rising demand for tubular batteries we are here to meet the growing requirement and satisfy their needs.</p>\r\n<p>Low maintenance is an important benefit that our battery shop gives to all its customers so that the users do not need to put distilled water all the time. Inverter battery price is pretty affordable for all types of customers and our online site has already recognized as a reliable one and we are getting some motivating feedback from the customers.</p>\r\n<b>Types of inverter batteries offered by Us</b>\r\n<p>Mainly there are three types of inverter batteries available in My Battery Shop according to the demand of maximum customers.</p>\r\n<b>Lead-acid batteries</b>\r\n<p>Lead-acid batteries are the most common type of inverter batteries available in the market. They are rechargeable and lightweight. Also, they produce a huge amount of current. As they are the oldest type of inverter battery so they require regular maintenance by the users and life span of these batteries are too short compared to other inverter batteries. It is approximately 3 to 4 hours. These batteries need to be kept in an isolated and well-ventilated room in the house because harmful gases come out from these batteries at the time of charging and discharging.</p>\r\n<b>Maintenance-free lead-acid batteries</b>\r\n<p>These are the updated version of the previous lead-acid batteries. These are sealed up and require very little maintenance or not require any maintenance. So the users do not need to check the electrolyte level regularly and also the adding of distilled water is not required. But also they are more expensive than normal lead-acid batteries and also have a short life span. Now all these kinds of batteries you can get easily at your doorstep with some decent inverter battery price.</p> \r\n<b>Tubular inverter batteries</b>\r\n<p>Now the most updated version of the inverter battery is here and it is relevant for any user to buy inverter battery online. When My Battery Shop is offering you the well-designed inverter batteries for your inverter then you don\'t need to check it from any other stores as My Battery Shop always provides its customers great service and the best quality product. In the description of tubular inverter batteries, we can say that our batteries are more efficient, more reliable and also have a longer life span with zero maintenance.</p>\r\n<b>Tips to select the best inverter battery</b>\r\n<p>When you choose the inverter batteries for any residential purposes than the first thing you need to check that the number of electrical appliances will be associated with the inverter. According to this number, you can get a brief idea about the capacity of the battery will be required. The power consumption of all the appliances, the nature of the appliances like sensitive or not, etc. Like if the efficiency of your inverter is 100% then it implies that the power requirement of all the electrical appliances and the power supplied by the inverter is the same. The power factor normally lies between0.6 to 0.8.</p>\r\n<p>So, from the upper content, it is cleared that how you will choose the appropriate battery for your inverter and also the types of inverter batteries you can get at best inverter battery price. So, if you are searching for a relevant and trustworthy website to purchase inverter batteries then do not waste your valuable time and visit the website of My Battery Shop. Buy inverter battery online which provides you the best quality product for your inverter for household appliances and also for some bigger usage like in industrial purposes.</p>', 2, NULL, 0, 1, 1, 1, 0, 'Inverter Battery Price, Buy Inverter Batteries Online at Best Prices in India', NULL, 'Mybatteryshop is the best online inverter battery store in Delhi, India that offers you to buy inverter batteries online with free installation. Get lowest inverter battery prices, features & specifications.', '2019-09-18 05:42:23', '2021-01-13 11:06:54'),
(4, 0, 'Inverter & Home UPS', 'inverter-home-ups', '<b>Some important fact on the inverter and home UPS</b>\r\n<p>Previously home UPS was used in computers only but after the recognition of its more functions, it is now using in various fields like in cordless cell phones, motors, etc. The most positive aspect of UPS is it prevents the additional loss of data and also it can be used for getting long power back up. On the other hand, the inverter has a huge application such as it can be used for all electrical appliances to provide power to them by converting DC supply to AC. Buy inverter/home UPS online from My Battery Shop with some trending features and benefits associated with these.</p>\r\n<b>Advantages of inverter or home UPS offered by My Battery Shop</b>\r\n<p>The basic thing with what all the customers are concerned about is whether their need is covering or not. Here some advantages of inverter or home UPS that you must need to know about before you are going to purchase. We are providing you the opportunity to pay us through cards or give cash after the delivery of the products. Along with this, we are offering you the facility of free installation of different inverter and home UPS.</p>\r\n<p>My battery shop provides its customers some different kinds of inverters which can control room temperature also. There are some compressor triggers and users can control the room temperature whenever they want by simply on and off the switch of the triggers.\r\nThere is a high time to buy inverter/home UPS online from the most reliable website of My Battery Shop, the most demanding online retailer currently. From here you can buy this kind of inverter that is also effective in decreasing the power-consuming by its all-new energy-saving operation.</p>\r\n<b>How to choose the right inverter for your home</b>\r\n<p>Certain important things need to be considered when you are going to choose an inverter for your own house. The basic and primary thing that needs to check 