(1, 'about', 'About us', 'Online Battery Store - Car & Inverter Batteries Online', '<p>My battery shop is one of the leading&nbsp;<strong>online battery stores in India</strong>&nbsp;which provides instant delivery of batteries of all types. Whether you need to&nbsp;<strong>buy car batteries online</strong>&nbsp;or you are looking for&nbsp;<strong>inverter battery</strong>, just browse our web-portal and select the type of battery you require, then choose your car manufacturer, select the model of your car and then you will be able to choose all the&nbsp;<strong>brands of car batteries</strong>&nbsp;we have on our store. Choose it by few simple clicks of your mouse and order them online by filling your complete details. You can also opt for cash on delivery and pay for your car or inverter battery once it reaches and get installed properly. We firmly believe in 100 % customer satisfaction and thus we make every possible effort to keep you happy.</p>\r\n\r\n<p>We have all the major brands of inverter and car batteries available for on our website and are authorized resellers of all these battery brands for</p>\r\n\r\n<h2>Car Battery</h2>\r\n\r\n<p>We have the largest collection&nbsp;<strong>car batteries online</strong>&nbsp;as we have tie-ups with all the battery manufacturers and they provide batteries for every car model which is available in the market. From entry level hatch backs to luxuries sedans like BMW, Audi and Mercedes, we have many options for each of the model. We also suggest you the best model for your car which will suit to your machine in a long run. We always believe in winning the trust of the customers as every happy customer for us is a medal won.</p>\r\n\r\n<h2>Inverter Battery</h2>\r\n\r\n<p>India is country where power cuts are very frequent and in that case people rely in inverter which can save them for many hours in long power cuts. Nowadays inverters have become advanced as and they act us UPS where you do not realize the power interruption when there is a power cut. We have best in class&nbsp;<strong>inverter batteries online</strong>&nbsp;which are very reliable and long lasting and can offer you uninterrupted power supply for long hours. Buy your favorite brand of inverter battery and relax at your home with proper power supply.</p>\r\n\r\n<h2>Inverter Battery + Inverter Combos</h2>\r\n\r\n<p><strong>Inverter Battery + Inverter Combos</strong>&nbsp;are also available on our website where we have listed all the major brands. You will have all the warranty and offers available which are provided by the manufacturers.</p>\r\n\r\n<h2>Generator Batteries</h2>\r\n\r\n<p>We also provide all types of&nbsp;<strong>generator batteries online</strong>&nbsp;on our portal which can be delivered just at your door step and you have to pay for the same your order is delivered and installed We are providing great offers and discounts for all the orders placed online through our website. You can ask for upcoming offers and other details through chat by our online customer support executive. If you want to talk, you can also call on customer care numbers and ask for all the details. We provide a&nbsp;<strong>7 days money back guarantee</strong>&nbsp;where we return you money if you we deliver wrong or non-functional batteries in any case. You can shop for all types of batteries as we have&nbsp;<strong>car batteries</strong>&nbsp;of every make and model online on our website and that too at best prices. You can shop for all the leading brands and car batteries like:</p>\r\n\r\n<ul>\r\n	<li>Amaron</li>\r\n	<li>SF Sonic</li>\r\n	<li>Tata Green</li>\r\n	<li>Exide</li>\r\n	<li>BASE</li>\r\n	<li>AF Delco</li>\r\n</ul>\r\n\r\n<h2>Shop for your car and inverter battery online from Mybatteryshop</h2>\r\n\r\n<p>Our website is very easy to&nbsp;<strong>shop for batteries</strong>&nbsp;as we have made our portal very easy to browse and convenient from the end user&rsquo;s point of view. All you need to do is select the model 