(2, 'returns', 'Return & Exchange', 'Contact usReturn & Exchange', '<div class=\"addressBar\">\r\n<h1><strong style=\"font-size: 13px;\">Little about us:</strong></h1>\r\nWe, My Battery shop are India&rsquo;s No.1 online multi-brand quality battery treasurer which deals with all brands. We are a company based in India&rsquo;s capital. We provide 100% original and genuine battery products like Amaron, Exide, Luminous, Microtek, Okaya, Su-Kam and many more. We are in this trade for over 20 years and have our own stores in Delhi &amp; NCR. We provide free home delivery &amp; installation within 2-4 hours (when your product is delivered). We provide an efficient service. So, be fearless while shopping with us.<br />\r\nCurrently, we are in Delhi,Noida Faridabad, Gurgaon, and Ghaziabad. We are soon going to start branches in other parts of the country too.<br />\r\n&nbsp;<br />\r\n<strong>Cancellation Policy</strong><br />\r\nWe assure our customers in helping them through this process and have some easy-going and simple cancellation policies.<br />\r\nDon&rsquo;t worry customers, we believe in serving you in the right way.<br />\r\nUnder cancellation policy:<br />\r\n<br />\r\n&nbsp;\r\n<ul>\r\n	<li>Cancellation request should be considered within 1 hour of placing an order. In case, if the orders have been informed to the vendors and they have processed the process of shipping then Rs.200 is charged for order cancellation fee. If Mybatteryshop.com.in cancels the order, then no cancellation fee will be charged. We cancel the order only due to non-availability or any other reason.</li>\r\n	<li>In case, the receipt is damaged or found defected, then do report to our customer care team about the issue which has been faced. We will resolve it and replace it with a brand new one without any hidden cost. The request will be valid only at the time of delivery of the product. Please do file the complaint immediately.<br />\r\n	&nbsp;</li>\r\n	<li>Suppose you feel that your product has been exchanged or it is not as per your order, then customers should bring this issue in front of the customer care team. This complaint should be done at the time of delivery and it will be resolved then and there.<br />\r\n	&nbsp;</li>\r\n	<li>If you have complaints or issues regarding the product&rsquo;s warranty, assurance or manufacturing, then please bring it to our notice. We will help you always in all ways.</li>\r\n</ul>\r\n&nbsp;<br />\r\n<strong>How to cancel the orders before you have received your product</strong><strong>?</strong><br />\r\nWe hope that you never have to face such situation, but still we will guide you through this procedure. If you have placed an order and wished to cancel it, kindly call or Customer Care number. For further assistance, you can also e-mail or Whatsapp us with all the important details related to your order of your product.&nbsp;&nbsp;<br />\r\n<strong>How to cancel my order if it&rsquo;s been already dispatched?</strong><br />\r\nMost of our orders are dispatched within 2 hours of receiving the order but sometimes the customers like to cancel it back due to some reasons. Then the customers have to bear the cost of Rs.200 as order cancellation fee.<br />\r\n&nbsp;<br />\r\n<strong>Customers who are Not Eligible for Return or Replacement</strong><br />\r\nSome customers are not eligible for returns or replacement of their product. As, it is in our policy; we follow them. Those people are:<br />\r\n<br />\r\n&nbsp;\r\n<ul>\r\n	<li>Any product that is returned without original packaging, which includes the box and all other items which were included during the time of delivery of the product.<br />\r\n	&nbsp;</li>\r\n	<li>The customer is not eligible for any defect/damage which is not covered under the manufacturer&rsquo;s warranty.<br />\r\n	&nbsp;</li>\r\n	<li>Products with fidgeted conditions or missing serial/UPC numbers.<br />\r\n	&nbsp;</li>\r\n	<li>Damages caused by misusing of the product.<br />\r\n	&nbsp;</li>\r\n	<li>Irregular damage due to malfunctioning of the product. &nbsp;&nbsp;</li>\r\n</ul>\r\n&nbsp;<br />\r\n<strong>Refund Policy</strong><br />\r\nThe given refund policy is applicable to the buyers who have initiated the cancellation of the order.<br />\r\n<br />\r\n&nbsp;\r\n<ul>\r\n	<li>Order cancelled before 24 hours of placing the order + process of shipping is not done = complete refund of product value.<br />\r\n	&nbsp;</li>\r\n	<li>Order cancelled within 24 hours of placing the order + process of shipping is done = cancellation fee will be charged.<br />\r\n	&nbsp;</li>\r\n	<li>For online payers: Order is cancelled after 24 hours of placing the order + process of shipping is not done = 2% of product value will be charged.<br />\r\n	&nbsp;</li>\r\n	<li>For online payers: Order is cancelled after 24 hours of placing the order + process of shipping is done = cancellation fee + 2% of product value will be charged.</li>\r\n</ul>\r\n&nbsp;&nbsp;<strong>How to receive the refund?</strong>&nbsp;After following the whole procedure, the refund amount of your returned product will be credited to your respective bank account/ credit card/ debit card/ net banking within 7- 10 business days. With the refund process, everonechoice.in will assist you with all your queries answers.<br />\r\nSo, do not lose faith in us and in our service. We assure you of our service team and service. Kindly do co-operate with our company and its process.&nbsp;&nbsp;<strong>7 Days Money Back Guarantee</strong>&nbsp;MyBatteryshop is India&rsquo;s finest multi-brand battery store where you can buy all types of car and inverter batteries online. Any battery or inverter bought from our portal can be returned for a money back claim with 7 days of delivery by calling our customer care 9999-444-005 or mail us on&nbsp;<a href=\"mailto:support@everyonechoice.com\">support@</a>Mybatteryshop.com&nbsp;. We sell our batteries &amp; inverters with a 7 days money back guarantee where you can claim your money back within seven days under these conditions\r\n\r\n<ul>\r\n	<li>If a defective or non-functional battery or inverter is delivered</li>\r\n	<li>If a wrong battery / product is delivered to you</li>\r\n	<li>If the battery delivered to you is dead</li>\r\n	<li>If the user finds that product&rsquo;s original packing was damaged or tempered</li>\r\n</ul>\r\nOnce the order is delivered to the customer and the product is found defective then customer must immediately inform to us regarding the defect / damage / non-functioning / or wrong order delivery at our customer care number 9999-444-005 or mail us on support@mybatteryshop.com. Then we arrange the process of refund, replacement or money back claim by sending our representative for collection of the product.<br />\r\n<strong>For money back / refund or replacement of any product, customer should be ready with relevant provisions like</strong>\r\n\r\n<ul>\r\n	<li>Customer must help our executive while the refund process by providing the product with complete packing, its manuals, warranty cards, accessories, booklets, freebies and other stuff that comes with the product.</li>\r\n	<li>While pick-up of the product, customer have to fill the acknowledgement form provided by us. That form must be kept by the customer safe and the same will be used in all the further communication with us for the refund / replacement / or money back claim.</li>\r\n</ul>\r\n<strong>If in case, any defect arises after the delivery, installation and demo of the product them </strong>My Battery shop <strong> is not responsible for any return or money back claim and in that case of such defects the service / support will be entertained by respective company / brand as per the company&rsquo;s respective norms or warranty terms.</strong></div>', '<div class=\"addressBar\">\r\n<h1>Cancellation &amp; Refund</h1>\r\n<strong>Little about us:</strong><br />\r\nWe, My Battery shop are India&rsquo;s No.1 online multi-brand quality battery treasurer which deals with all brands. We are a company based in India&rsquo;s capital. We provide 100% original and genuine battery products like Amaron, Exide, Luminous, Microtek, Okaya, Su-Kam and many more. We are in this trade for over 20 years and have our own stores in Delhi &amp; NCR. We provide free home delivery &amp; installation within 2-4 hours (when your product is delivered). We provide an efficient service. So, be fearless while shopping with us.<br />\r\nCurrently, we are in Delhi,Noida Faridabad, Gurgaon, and Ghaziabad. We are soon going to start branches in other parts of the country too.<br />\r\n&nbsp;<br />\r\n<strong>Cancellation Policy</strong><br />\r\nWe assure our customers in helping them through this process and have some easy-going and simple cancellation policies.<br />\r\nDon&rsquo;t worry customers, we believe in serving you in the right way.<br />\r\nUnder cancellation policy:<br />\r\n<br />\r\n&nbsp;\r\n<ul>\r\n	<li>Cancellation request should be considered within 1 hour of placing an order. In case, if the orders have been informed to the vendors and they have processed the process of shipping then Rs.200 is charged for order cancellation fee. If Mybatteryshop.com.in cancels the order, then no cancellation fee will be charged. We cancel the order only due to non-availability or any other reason.</li>\r\n	<li>In case, the receipt is damaged or found defected, then do report to our customer care team about the issue which has been faced. We will resolve it and replace it with a brand new one without any hidden cost. The request will be valid only at the time of delivery of the product. Please do file the complaint immediately.<br />\r\n	&nbsp;</li>\r\n	<li>Suppose you feel that your product has been exchanged or it is not as per your order, then customers should bring this issue in front of the customer care team. This complaint should be done at the time of delivery and it will be resolved then and there.<br />\r\n	&nbsp;</li>\r\n	<li>If you have complaints or issues regarding the product&rsquo;s warranty, assurance or manufacturing, then please bring it to our notice. We will help you always in all ways.</li>\r\n</ul>\r\n&nbsp;<br />\r\n<strong>How to cancel the orders before you have received your product</strong><strong>?</strong><br />\r\nWe hope that you never have to face such situation, but still we will guide you through this procedure. If you have placed an order and wished to cancel it, kindly call or Customer Care number. For further assistance, you can also e-mail or Whatsapp us with all the important details related to your order of your product.&nbsp;&nbsp;<br />\r\n<strong>How to cancel my order if it&rsquo;s been already dispatched?</strong><br />\r\nMost of our orders are dispatched within 2 hours of receiving the order but sometimes the customers like to cancel it back due to some reasons. Then the customers have to bear the cost of Rs.200 as order cancellation fee.<br />\r\n&nbsp;<br />\r\n<strong>Customers who are Not Eligible for Return or Replacement</strong><br />\r\nSome customers are not eligible for returns or replacement of their product. As, it is in our policy; we follow them. Those people are:<br />\r\n<br />\r\n&nbsp;\r\n<ul>\r\n	<li>Any product that is returned without original packaging, which includes the box and all other items which were included during the time of delivery of the product.<br />\r\n	&nbsp;</li>\r\n	<li>The customer is not eligible for any defect/damage which is not covered under the manufacturer&rsquo;s warranty.<br />\r\n	&nbsp;</li>\r\n	<li>Products with fidgeted conditions or missing serial/UPC numbers.<br />\r\n	&nbsp;</li>\r\n	<li>Damages caused by misusing of the product.<br />\r\n	&nbsp;</li>\r\n	<li>Irregular damage due to malfunctioning of the product. &nbsp;&nbsp;</li>\r\n</ul>\r\n&nbsp;<br />\r\n<strong>Refund Policy</strong><br />\r\nThe given refund policy is applicable to the buyers who have initiated the cancellation of the order.<br />\r\n<br />\r\n&nbsp;\r\n<ul>\r\n	<li>Order cancelled before 24 hours of placing the order + process of shipping is not done = complete refund of product value.<br />\r\n	&nbsp;</li>\r\n	<li>Order cancelled within 24 hours of placing the order + process of shipping is done = cancellation fee will be charged.<br />\r\n	&nbsp;</li>\r\n	<li>For online payers: Order is cancelled after 24 hours of placing the order + process of shipping is not done = 2% of product value will be charged.<br />\r\n	&nbsp;</li>\r\n	<li>For online payers: Order is cancelled after 24 hours of placing the order + process of shipping is done = cancellation fee + 2% of product value will be charged.</li>\r\n</ul>\r\n&nbsp;&nbsp;<strong>How to receive the refund?</strong>&nbsp;After following the whole procedure, the refund amount of your returned product will be credited to your respective bank account/ credit card/ debit card/ net banking within 7- 10 business days. With the refund process, everonechoice.in will assist you with all your queries answers.<br />\r\nSo, do not lose faith in us and in our service. We assure you of our service team and service. Kindly do co-operate with our company and its process.&nbsp;&nbsp;<strong>7 Days Money Back Guarantee</strong>&nbsp;MyBatteryshop is India&rsquo;s finest multi-brand battery store where you can buy all types of car and inverter batteries online. Any battery or inverter bought from our portal can be returned for a money back claim with 7 days of delivery by calling our customer care 9999-444-005 or mail us on&nbsp;<a href=\"mailto:support@everyonechoice.com\">support@</a>Mybatteryshop.com&nbsp;. We sell our batteries &amp; inverters with a 7 days money back guarantee where you can claim your money back within seven days under these conditions\r\n\r\n<ul>\r\n	<li>If a defective or non-functional battery or inverter is delivered</li>\r\n	<li>If a wrong battery / product is delivered to you</li>\r\n	<li>If the battery delivered to you is dead</li>\r\n	<li>If the user finds that product&rsquo;s original packing was damaged or tempered</li>\r\n</ul>\r\nOnce the order is delivered to the customer and the product is found defective then customer must immediately inform to us regarding the defect / damage / non-functioning / or wrong order delivery at our customer care number 9999-444-005 or mail us on support@mybatteryshop.com. Then we arrange the process of refund, replacement or money back claim by sending our representative for collection of the product.<br />\r\n<strong>For money back / refund or replacement of any product, customer should be ready with relevant provisions like</strong>\r\n\r\n<ul>\r\n	<li>Customer must help our executive while the refund process by providing the product with complete packing, its manuals, warranty cards, accessories, booklets, freebies and other stuff that comes with the product.</li>\r\n	<li>While pick-up of the product, customer have to fill the acknowledgement form provided by us. That form must be kept by the customer safe and the same will be used in all the further communication with us for the refund / replacement / or money back claim.</li>\r\n</ul>\r\n<strong>If in case, any defect arises after the delivery, installation and demo of the product them </strong>My Battery shop <strong> is not responsible for any return or money back claim and in that case of such defects the service / support will be entertained by respective company / brand as per the company&rsquo;s respective norms or warranty terms.</strong></div>', '', 'Return & Exchange', 'Return & Exchange', 'Return & Exchange', 1, '2018-02-28 13:46:59', '2019-09-24 06:46:39');
