ation</h3>\r\n				<p>\r\n				B2b Clothings may use your personal information to: \r\n				</p>\r\n				<ul class=\"listimgli\">\r\n				<li>Administer this website;</li>\r\n				<li>Personalize the website for you;</li>\r\n				<li>Enable your access to and use of the website services;</li>\r\n				<li>Publish information about you on the website;</li>\r\n				<li>Send to you products that you purchase;</li>\r\n				<li>Supply to you services that you purchase;</li>\r\n				<li>Send to you statements and invoices;</li>\r\n				<li>Collect payments from you; and</li>\r\n				<li>Send you marketing communications.</li>\r\n				</ul>\r\n				<p>\r\n				Where B2b Clothings discloses your personal information to its agents or sub-contractors for these purposes, the agent or sub-contractor in question will be obligated to use that personal information in accordance with the terms of this privacy statement. \r\n				</p>\r\n				<p>\r\n				In addition to the disclosures reasonably necessary for the purposes identified elsewhere above, B2b Clothings may disclose your personal information to the extent that it is required to do so by law, in connection with any legal proceedings or prospective legal proceedings, and in order to establish, exercise or defend its legal rights.\r\n				</p>\r\n				<h3>Securing your data</h3>\r\n				<p>\r\n				B2b Clothings will take reasonable technical and organisational precautions to prevent the loss, misuse or alteration of your personal information.\r\n				</p>\r\n				<p>\r\n				B2b Clothings will store all the personal information you provide [on its secure servers].\r\n				</p>\r\n				<p>\r\n				[Information relating to electronic transactions entered into via this website will be protected by encryption technology.]\r\n				</p>\r\n				<h3>Updating this statement</h3>\r\n				<p>\r\n				B2b Clothings may update this privacy policy by posting a new version on this website. \r\n				</p>\r\n				<p>\r\n				You should check this page occasionally to ensure you are familiar with any changes.  \r\n				</p>\r\n				<h3>Other websites</h3>\r\n				<p>\r\n				This website contains links to other websites.\r\n				</p>\r\n				<p>\r\n				[NAME] is not responsible for the privacy policies or practices of any third party.\r\n				</p>\r\n				<h3>Contact B2b Clothings</h3>\r\n				<p>\r\n				If you have any questions about this privacy policy or B2b Clothings\'s treatment of your personal information, please write to us:\r\n				</p>\r\n				<ul class=\"listimgli\">\r\n				<li>By email to <a href=\"mailto:support@B2b Clothings\">support@B2b Clothings</a>, or </li>\r\n				<li>By post to 9/7038, Ashok Gali,</li>\r\n				<li>Gandhi Nagar, Delhi-110031.</li>\r\n				</ul>', 'Privacy Policy', NULL, NULL, 1, '2018-02-28 13:46:59', '2019-09-24 06:47:07'),
(5, 'faq', 'FAQ', 'FAQ', '<p><strong>How will I know that my battery order has been confirmed by My battery Shop?</strong><br />\r\nThe moment you place your order and make your payment, you will receive a call from our verification manager. The manager will be making this call to confirm and verify the order, shipping details, and customer availability. After the confirmation call is over, you will receive an e-mail with product summary and estimated delivery time, thus, confirming the order. The e-mail will also contain the order ID so that you can refer it.<br />\r\n&nbsp;<br />\r\n<strong>Will there be any hidden charges like Service Tax for the battery purchase I make?</strong><br />\r\nThe prices of the batteries and the inverters that are mentioned on the website are fixed and it includes everything. They do not contain any kind of hidden costs, service taxes or any sort of extra charges. You will pay the exact amount you see on the website.<br />\r\n&nbsp;<br />\r\n<strong>Is it possible for me to select the time of delivery in a way that suits me?</strong><br />\r\nOnce you order the battery, all you have to do is wait for our verification manager to call you to confirm the details of the order. In this call, you will be asked about your availability too. We usually deliver the battery within 2-4 hours after your order is confirmed by our verification manager. But you can mention a time for delivery that suits you. It is not really possible to deliver at the exact mentioned time because of various reasons like a traffic jam, bad weather, political disruption, or unavailability of the product. Also, you have to remember that this is restricted to the orders that are confirmed before 5 PM. We cannot promise the same day delivery of orders that are confirmed after 5 PM.<br />\r\n&nbsp;<br />\r\n<strong>Will I be receiving batteries that are charged?</strong><br />\r\nThe batteries you will be receiving will be completely charged. They will be ready to use the moment they are installed?<br />\r\n&nbsp;<br />\r\n<strong>Who will be taking care of After Sales Service once I receive the battery?</strong><br />\r\nSimilar to most products, the battery manufacturer is the one who will take care of the after sales service. If you have bought a battery from us and if it faces some kind of issue in its warranty period, then the right thing for you to do is contacting the battery manufacturer. For example, if your Amaron battery that is under warranty needs to be checked, you have to contact the Amaron Service Centre.<br />\r\n&nbsp;<br />\r\n<strong>What are the general reasons that make a car battery weak?</strong><br />\r\nThere are various reasons for the weakening of a car battery. You need to know what they are. This way, you can maintain it properly and increase its longevity. The most common reason for a battery to fail is driving in a rough or rash way. Using the power of the battery massively for things like air-conditioning, music system, lighting also makes the battery weak.<br />\r\n&nbsp;<br />\r\n<strong>How will I know that my car battery is facing problems and needs to be repaired?</strong><br />\r\nThere are some general signs which indicate you that the battery of your car is getting old. This is the moment you will know that you need to buy a replacement. Those signs are:<br />\r\n&nbsp;The car cabin will stop cooling properly causing heating issues.</p>\r\n\r\n<ul>\r\n	<li>The different electrical devices that are in the car will stop functioning properly.<br />\r\n	&nbsp;</li>\r\n	<li>The headlights of your car start to look dim or dull whenever your car is at idle and then it starts to brighten when you rev the car&rsquo;s engine.<br />\r\n	&nbsp;</li>\r\n	<li>You will see a face a lot of problems whenever you are trying to start/ignite the engine of your car.</li>\r\n</ul>\r\n\r\n<p>&nbsp;<strong>How is it possible for me to maintain the battery of my car?</strong><br />\r\nIf you learn to properly maintain the battery of your car, you will be able to increase the battery&rsquo;s performance and, of course, its life. You just have to follow these important tips to make sure that your car battery&rsquo;s longevity is maintained. But just remember to carefully follow them because if you don&rsquo;t follow it properly, you may face hazardous and dangerous problems.<br />\r\n&nbsp;Regularly clean the dust from the battery of your car to avoid corrosion. You have to clean the battery surface and the case too.</p>\r\n\r\n<ul>\r\n	<li>Even then if you find some sort of corrosion in the battery of your car, clean it off by using the solution of baking soda.<br />\r\n	&nbsp;</li>\r\n	<li>Keep inspecting for different sorts of damages in the battery. Also, make sure it is always fully charged. Do not forget the wires which connect the battery completely clean.<br />\r\n	&nbsp;</li>\r\n	<li>Lubricate the battery cables with Vaseline or any other petroleum jelly regularly.&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li>If the car battery is in an idle condition, switch off all the electronic devices.&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>Make sure the battery&rsquo;s fluid level is always full. Keep checking it</p>', '<p>FAQ</p>', '', 'FAQ', NULL, NULL, 1, '2018-02-28 13:46:59', '2019-09-24 06:53:30');
