(6, 'warranty', 'Warranty', 'Warranty', '<p>Batteries are a boon to people who stay in areas where there are huge electricity problems. Frequent power cuts not only affect lots of work but also spoil our mood. Imagine that you are sitting in front of your computer to do very important work, and there is a power cut. In such cases, a backup is necessary in order to continue our work unaffected.<br />\r\nNow, the question is which battery or inverter to choose, which is reliable and will solve our problems. My Battery shop has a large collection of batteries of well-known brands which are 100% genuine and come with a manufacturer warranty.<br />\r\nNow, the warranty is a very important facility given to any customer who buys any specific device. For a specific period of time, as decided by the brand, if there is any problem with the device while using it, the manufacturer will change the device or repair it without asking for money.<br />\r\nThe batteries we have at My Battery shop have different warranties as decided by their manufacturers. Batteries of Exide, Amaron, Luminous and Su-Kam are available at this site, and the decision of the manufacturer on their batteries is the final one.<br />\r\n<br />\r\n<strong>When to claim for the warranty?</strong><br />\r\nThe chance of any problem occurring with the device is very less but if you face any kind of problem, we are there to help you. We will help you whenever there are:</p>\r\n\r\n<ul>\r\n	<li>Installation problems with the device or whenever the customers are not able to understand the proper working of the device.<br />\r\n	&nbsp;</li>\r\n	<li>Technical issues with the batteries.<br />\r\n	&nbsp;</li>\r\n	<li>The battery is not charging properly or is not working for the desired number of hours.</li>\r\n</ul>\r\n\r\n<p><br />\r\nFor any problem, contact the customer care service of the respective batteries. The customers will be given free service if the product if it is within the warranty period.<br />\r\n<br />\r\n<strong>How to claim for any product during the Warranty Period?</strong><br />\r\nA procedure is followed to claim the product which is within the warranty period. Few original documents are required to claim for the repair or replace the product. The steps to claim for your warranty are:<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Present your original Documents:</strong></li>\r\n</ul>\r\n\r\n<p>The customers are provided bills and the warranty card during the purchase of the product. The original copy of the bill and the warranty cards must be there for claiming for the warranty of their product.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Call customer care:</strong></li>\r\n</ul>\r\n\r\n<p>Each and every brand has their service centers which are specially made to solve the problems of their customers. A particular customer care number is provided to the users. Therefore, in the case of any issue with the device, quickly call the customer care service of the respective manufacturer. Provide the representative the details of the product and explain to them the problem you have been facing.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Schedule a Day:</strong></li>\r\n</ul>\r\n\r\n<p>The professionals of the customer care office of the different manufacturers look into the problem, and if assistance is required, they go for an inspection. A particular day should be fixed by you; when you can explain the problems you have been facing. They diagnose and resolve your problem.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>You must present the original documents which include the bill and the warranty card and should hand over a copy of the documents to the service personnel who attends your device.<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>For any technical problems, installation or other related problems give a call to the customer care service of the respective manufacturers. Few devices have the warranty details installed on the devic