(15, 0, 'make', 'Nissan', 'nissan', 1, '<p>Nissan Motor Co. LTD, or simply Nissan, is a Japanese company, which is known for manufacturing highly-efficient cars. The brand was founded almost 86 years ago from today, in the year of 1933, and has been offering their service since then. Since 1999, Nissan has started a joint venture with Renault brand, and since then, both the brands have been working together.<br /><br />\r\nHowever, most of the cars of Nissan are known to be quite powerful. Therefore, most of the car owners generally buy Amaron, Exide, SF Sonic car battery for Nissan. Other than being cost-efficient, these batteries are also known to be quite efficient. So, if you take a good care of them, then they will last for a long time. <br /><br />\r\nSo, if you want to know more on the aspects of Nissan car battery price, then make sure to visit our website. Here, aside from the batteries of Nissan cars, you can also find car batteries other brands. So, if you need anything, we will always be there for you to help.</p>', '15_nissian.png', NULL, NULL, NULL, NULL, 12, 1, 1, '2015-10-23 00:00:00', '2020-01-31 13:24:48'),
