(1165, 0, 'make', 'Caterpillar India', 'caterpillar-india', 2, '<p>We at My Battery Shop host the best generator batteries from varieties of brands. Among all other brands, one of the best that we provide to you is Caterpillar India. In the case of manufacturing the high-grade generator batteries, this Indian company has become the most favorite trade name. The caterpillar India Genset batteries offer you to relish a smooth service. Apart from that, its durability and eco-friendly nature make it the most preferable one. The caterpillar India batteries are powerful and serve you with an uninterrupted power supply. Having the supreme qualities, these batteries come in the extremely affordable price range. If you want to get the best deal on the Genset batteries, make sure to buy the Caterpillar India Genset batteries online from our website.</p> \r\n<p>In fact, with the mentioned battery, we will get to relish a great period of warranty. The battery is manufactured with a warranty of 24 months, which is appraisable. There are other benefits too. For having a wide input voltage capacity, the battery is able to take a load of several electric appliances for a long period. Therefore, if your living area suffers from frequent power loss, the Caterpillar India Genset batteries can be the perfect power supply for you. The price range of the product changes according to its capacity.  If you pick our website to make your investment on the product, you would get amazing discounts on the Caterpillar India Genset battery price. Moreover, as a complementary offer, we will facilitate you with free delivery and installation by our certified technicians.</p>', '1296_caterpillar-india-logo.png', NULL, NULL, NULL, NULL, 2, 0, 1, '2019-09-19 15:22:47', '2020-03-04 07:44:55'),
(1166, 0, 'make', 'Cummins', 'cummins', 2, '<p>One of the finest choices in Genset batteries at our website, My Battery Shop is the Cumin Genset batteries. These batteries are chiefly constructed with the best skills to increase their durability. Unlike the lead-acid batteries, these Genset batteries serve you with more advanced technology. The manufacturers utilize the pure lead-tin alloy to design these batteries, which especially works in improving its performance and durability. Along with that, such an amazing construction reduces the corrosion, which is again favorable for increasing its life expectancy. Furthermore, owing to the lead-tin alloy body, the Cummins Genset battery can work perfectly in an extreme point of temperatures. The Cummins Genset battery price is extremely reasonable for its outstanding features.</p>\r\n<p>With a warranty of 24 months, these generator batteries provide you with sufficient and convenient power supply. Generally, the capacity of the Cummins Genset batteries starts from 65 AH to 100 AH. Pick the most suitable one according to your preferences. However, to get the best pricing, you can check out the fair expenses of the Cummins Genset batteries online from our website. On purchase, we offer you to enjoy the service of free delivery along with the assistance of the free installation. These generator batteries are perfectly sealed, thus, there is no risk of harmful emission. Therefore, these Genset batteries can be a great pick for home, school or even in commercial offices. For any further information regarding the Cummins Genset Batteries, make sure to visit our website. We are available for you 24/7.</p>', '1311_cummins-logo.png', NULL, NULL, NULL, NULL, 3, 0, 1, '2019-09-19 15:22:47', '2020-03-04 07:45:58'),
(1167, 0, 'make', 'Greaves', 'greaves', 2, '<p>A leading Genset battery brand of My Battery Shop is the Greaves Genset batteries. Both in efficiency and durability, these batteries meet with every expectation of the buyers. Regardless to mention, it is one of the top-selling generator batteries on our website. The battery is chiefly popular owing to its high-grade power supply. It comes in several load-taking capacities. The battery is more in demand because of the trustworthy brand Greaves. There are different types of Greaves Genset batteries available on our website based on its capacity. If you want to have detailed information about the types and the Greaves Genset Battery price online, you can conveniently go through our website. We hold several discounts on the products to ensure that you get the best product in an affordable deal.</p>  \r\n<p>The best part of the Greaves Genset batteries is that unlike other generators, extreme heat or chilly cold is not at all troublesome with these batteries. Without any hassle, you can operate these batteries conveniently. The power supplying capacity of the Greaves Genset batteries are supreme. These batteries are specially manufactured to cope up with the frequent power cut in Indian regions. One more attribute of the battery that is to mention is its low maintenance. Unlike other generator batteries, this one does not require you to spend extra pennies on its maintenance. Alongside this, the greaves batteries come with 2 years of warranty. You can choose to purchase it from any physical store. But preferring our website to buy Greaves Genset batteries online offers you a fair with the facility of free delivery and installation service.</p>', '1314_greaves-logo.png', NULL, NULL, NULL, NULL, 4, 0, 1, '2019-09-19 15:22:47', '2020-03-04 07:47:27'),
(1168, 0, 'make', 'Kirloskar', 'kirloskar', 2, '<p>One of the favorite choices of the customer and best selling products are the Kirloskar Genset batteries. This company was established dated back to the year 1888 and since then, the Kirloskar group started manufacturing many products in the industry. among all the other things the Genset batteries became very popular. You don\'t have to go visit the shop to buy this battery, you can buy Kirloskar Genset Batteries online on our website of mybatteryshop. it will save you a lot of time and it will be easy for you to choose the best one for you sitting at home. Kirloskar batteries are very well known for reliability, durability, and high-quality batteries. Kirloskar has more than 9 manufacturing units spread in the country. One of the best things about Kirloskar Genset batteries is that they are made of the latest technologies.</p>\r\n<p>There are many types of Genset batteries available on our website. They are all different from others by the power unit. Some of the common ones include Kirloskar freedom series 12.5KVA - 25 KVA, Kirloskar Republic series 30 KVA -160 KVA, Kirloskar independent series 180 KVA, and Kirloskar Independent series 500 KVA. Apart from this, you can get many more different power units on our website. You can see the Kirloskar Genset battery price list on our site to choose the best-suited one for you. If you buy the Kirloskar Genset batteries from us, then you will get a maximum of 24 months\' warranty and a minimum of 18 months.</p>', '1317_kirloskar-logo.png', NULL, NULL, NULL, NULL, 5, 0, 1, '2019-09-19 15:22:47', '2021-01-21 10:36:57'),
